"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[9470],{56374:(e,t,s)=>{s.r(t),s.d(t,{default:()=>a,johnChapter11ES:()=>o});const o={chapter:11,title:"Jean 11",version:"Reina-Valera 1909",language:"es",direction:"ltr",verses:[{number:1,text:"Estaba entonces enfermo uno llamado L\xe1zaro, de Bethania, la aldea de Mar\xeda y de Marta su hermana.",strong:[{text:"enfermo",strong:"G772",start:16,end:23}]},{number:2,text:"(Y Mar\xeda, cuyo hermano L\xe1zaro estaba enfermo, fue la que ungi\xf3 al Se\xf1or con ung\xfcento, y limpi\xf3 sus pies con sus cabellos.)",strong:[{text:"enfermo",strong:"G772",start:37,end:44}]},{number:3,text:"Enviaron, pues, las hermanas \xe1 \xe9l, diciendo: Se\xf1or, he aqu\xed, el que amas est\xe1 enfermo.",strong:[{text:"enfermo",strong:"G772",start:78,end:85}]},{number:4,text:"Y oy\xe9ndolo Jes\xfas, dijo: Esta enfermedad no es para muerte, mas por gloria de Dios, para que el Hijo de Dios sea glorificado por ella.",strong:[{text:"Esta",strong:"G3778",start:24,end:28},{text:"muerte",strong:"H6757",start:51,end:57},{text:"Dios",strong:"G2316",start:77,end:81},{text:"Hijo",strong:"G5207",start:95,end:99},{text:"Dios",strong:"G2316",start:103,end:107}]},{number:5,text:"Y amaba Jes\xfas \xe1 Marta, y \xe1 su hermana, y \xe1 L\xe1zaro.",strong:[]},{number:6,text:"Cuando oy\xf3 pues que estaba enfermo, qued\xf3se a\xfan dos d\xedas en aquel lugar donde estaba.",strong:[{text:"enfermo",strong:"G772",start:27,end:34}]},{number:7,text:"Luego, despu\xe9s de esto, dijo \xe1 los disc\xedpulos: Vamos \xe1 Judea otra vez.",strong:[{text:"esto",strong:"G3778",start:18,end:22}]},{number:8,text:"D\xedcenle los disc\xedpulos: Rabb\xed, ahora procuraban los Jud\xedos apedrearte, \xbfy otra vez vas all\xe1?",strong:[{text:"tout",strong:"G3956",start:43,end:47}]},{number:9,text:"Respondi\xf3 Jes\xfas: \xbfNo hay doce horas del d\xeda? El que anduviere de d\xeda, no tropieza, porque ve la luz de este mundo.",strong:[{text:"este",strong:"G3778",start:103,end:107},{text:"mundo",strong:"G2889",start:108,end:113}]},{number:10,text:"Mas el que anduviere de noche, tropieza, porque no hay luz en \xe9l.",strong:[{text:"noche",strong:"G3571",start:24,end:29}]},{number:11,text:"Dicho esto, d\xedceles despu\xe9s: L\xe1zaro nuestro amigo duerme; mas voy \xe1 despertarle del sue\xf1o.",strong:[{text:"esto",strong:"G3778",start:6,end:10}]},{number:12,text:"Dijeron entonces sus disc\xedpulos: Se\xf1or, si duerme, salvo estar\xe1.",strong:[{text:"estar",strong:"G5463",start:57,end:62}]},{number:13,text:"Mas esto dec\xeda Jes\xfas de la muerte de \xe9l: y ellos pensaron que hablaba del reposar del sue\xf1o.",strong:[{text:"esto",strong:"G3778",start:4,end:8},{text:"muerte",strong:"H6757",start:27,end:33},{text:"reposar",strong:"H7257",start:74,end:81}]},{number:14,text:"Entonces, pues, Jes\xfas les dijo claramente: L\xe1zaro es muerto;",strong:[{text:"mort",strong:"H6757",start:45,end:49}]},{number:15,text:"Y hu\xe9lgome por vosotros, que yo no haya estado all\xed, para que cre\xe1is: mas vamos \xe1 \xe9l.",strong:[]},{number:16,text:"Dijo entonces Tom\xe1s, el que se dice el D\xeddimo, \xe1 sus condisc\xedpulos: Vamos tambi\xe9n nosotros, para que muramos con \xe9l.",strong:[{text:"Thomas",strong:"G2381",start:9,end:15},{text:"avec",strong:"G1848",start:87,end:91}]},{number:17,text:"Vino pues Jes\xfas, y hall\xf3 que hab\xeda ya cuatro d\xedas que estaba en el sepulcro.",strong:[{text:"dans",strong:"H6887",start:70,end:74}]},{number:18,text:"Y Bethania estaba cerca de Jerusalem, como quince estadios.",strong:[{text:"como",strong:"G2531",start:38,end:42}]},{number:19,text:"Y muchos de los Jud\xedos hab\xedan venido \xe1 Marta y \xe1 Mar\xeda, \xe1 consolarlas de su hermano.",strong:[{text:"beaucoup",strong:"G4183",start:0,end:8},{text:"mort",strong:"H6757",start:78,end:82}]},{number:20,text:"Entonces Marta, como oy\xf3 que Jes\xfas ven\xeda, sali\xf3 \xe1 encontrarle; mas Mar\xeda se estuvo en casa.",strong:[{text:"como",strong:"G2531",start:16,end:20},{text:"casa",strong:"G3609",start:86,end:90}]},{number:21,text:"Y Marta dijo \xe1 Jes\xfas: Se\xf1or, si hubieras estado aqu\xed, mi hermano no fuera muerto.",strong:[{text:"Seigneur",strong:"G2962",start:20,end:28},{text:"mort",strong:"H6757",start:76,end:80}]},{number:22,text:"Mas tambi\xe9n s\xe9 ahora, que todo lo que pidieres de Dios, te dar\xe1 Dios.",strong:[{text:"todo",strong:"G3956",start:26,end:30},{text:"Dios",strong:"G2316",start:50,end:54},{text:"Dios",strong:"G2316",start:64,end:68}]},{number:23,text:"D\xedcele Jes\xfas: Resucitar\xe1 tu hermano.",strong:[]},{number:24,text:"Marta le dice: Yo s\xe9 que resucitar\xe1 en la resurrecci\xf3n en el d\xeda postrero.",strong:[{text:"jour",strong:"H3117",start:79,end:83}]},{number:25,text:"D\xedcele Jes\xfas: Yo soy la resurrecci\xf3n y la vida: el que cree en m\xed, aunque est\xe9 muerto, vivir\xe1.",strong:[{text:"vida",strong:"G2222",start:42,end:46}]},{number:26,text:"Y todo aquel que vive y cree en m\xed, no morir\xe1 eternamente. \xbfCrees esto?",strong:[{text:"todo",strong:"G3956",start:2,end:6},{text:"esto",strong:"G3778",start:66,end:70}]},{number:27,text:"D\xedcele: S\xed Se\xf1or; yo he cre\xeddo que t\xfa eres el Cristo, el Hijo de Dios, que has venido al mundo.",strong:[{text:"Cristo",strong:"G5547",start:46,end:52},{text:"Hijo",strong:"G5207",start:57,end:61},{text:"Dios",strong:"G2316",start:65,end:69},{text:"mundo",strong:"G2889",start:89,end:94}]},{number:28,text:"Y esto dicho, fu\xe9se, y llam\xf3 en secreto \xe1 Mar\xeda su hermana, diciendo: El Maestro est\xe1 aqu\xed y te llama.",strong:[{text:"esto",strong:"G3778",start:2,end:6},{text:"Maestro",strong:"G1320",start:73,end:80}]},{number:29,text:"Ella, como lo oy\xf3, lev\xe1ntase prestamente y viene \xe1 \xe9l.",strong:[{text:"como",strong:"G2531",start:6,end:10}]},{number:30,text:"(Que a\xfan no hab\xeda llegado Jes\xfas \xe1 la aldea, mas estaba en aquel lugar donde Marta le hab\xeda encontrado.)",strong:[{text:"dans",strong:"H6887",start:35,end:39},{text:"dans",strong:"H6887",start:66,end:70}]},{number:31,text:"Entonces los Jud\xedos que estaban en casa con ella, y la consolaban, como vieron que Mar\xeda se hab\xeda levantado prestamente, y hab\xeda salido, sigui\xe9ronla, diciendo: Va al sepulcro \xe1 llorar all\xed.",strong:[{text:"casa",strong:"G3609",start:35,end:39},{text:"como",strong:"G2531",start:67,end:71}]},{number:32,text:"Mas Mar\xeda, como vino donde estaba Jes\xfas, vi\xe9ndole, derrib\xf3se \xe1 sus pies, dici\xe9ndole: Se\xf1or, si hubieras estado aqu\xed, no fuera muerto mi hermano.",strong:[{text:"como",strong:"G2531",start:11,end:15}]},{number:33,text:"Jes\xfas entonces, como la vi\xf3 llorando, y \xe1 los Jud\xedos que hab\xedan venido juntamente con ella llorando, se conmovi\xf3 en esp\xedritu, y turb\xf3se,",strong:[{text:"como",strong:"G2531",start:16,end:20}]},{number:34,text:"Y dijo: \xbfD\xf3nde le pusisteis? Dicenle: Se\xf1or, ven, y ve.",strong:[{text:"Seigneur",strong:"G2962",start:31,end:39}]},{number:35,text:"Y llor\xf3 Jes\xfas.",strong:[]},{number:36,text:"Dijeron entonces los Jud\xedos: Mirad c\xf3mo le amaba.",strong:[{text:"comme",strong:"G2531",start:33,end:38}]},{number:37,text:"Y algunos de ellos dijeron: \xbfNo pod\xeda \xe9ste, que abri\xf3 los ojos al ciego, hacer que \xe9ste no muriera?",strong:[{text:"hacer",strong:"G1080",start:73,end:78}]},{number:38,text:"Y Jes\xfas, conmovi\xe9ndose otra vez en s\xed mismo, vino al sepulcro. Era una cueva, la cual ten\xeda una piedra encima.",strong:[{text:"nouveau",strong:"G2537",start:20,end:27}]},{number:39,text:"Dice Jes\xfas: Quitad la piedra. Marta, la hermana del que se hab\xeda muerto, le dice: Se\xf1or, hiede ya, que es de cuatro d\xedas.",strong:[{text:"mort",strong:"H6757",start:46,end:50},{text:"Seigneur",strong:"G2962",start:61,end:69}]},{number:40,text:"Jes\xfas le dice: \xbfNo te he dicho que, si creyeres, ver\xe1s la gloria de Dios?",strong:[{text:"Dios",strong:"G2316",start:68,end:72}]},{number:41,text:"Entonces quitaron la piedra de donde el muerto hab\xeda sido puesto. Y Jes\xfas, alzando los ojos arriba, dijo: Padre, gracias te doy que me has o\xeddo.",strong:[{text:"Padre",strong:"G3962",start:106,end:111}]},{number:42,text:"Que yo sab\xeda que siempre me oyes; mas por causa de la compa\xf1\xeda que est\xe1 alrededor, lo dije, para que crean que t\xfa me has enviado.",strong:[{text:"siempre",strong:"H5769",start:17,end:24}]},{number:43,text:"Y habiendo dicho estas cosas, clam\xf3 \xe1 gran voz: L\xe1zaro, ven fuera.",strong:[]},{number:44,text:"Y el que hab\xeda estado muerto, sali\xf3, atadas las manos y los pies con vendas; y su rostro estaba envuelto en un sudario. D\xedceles Jes\xfas: Desatadle, y dejadle ir.",strong:[{text:"mort",strong:"H6757",start:6,end:10},{text:"aller",strong:"G4198",start:134,end:139}]},{number:45,text:"Entonces muchos de los Jud\xedos que hab\xedan venido \xe1 Mar\xeda, y hab\xedan visto lo que hab\xeda hecho Jes\xfas, creyeron en \xe9l.",strong:[]},{number:46,text:"Mas algunos de ellos fueron \xe1 los Fariseos, y dij\xe9ronles lo que Jes\xfas hab\xeda hecho.",strong:[]},{number:47,text:"Entonces los pont\xedfices y los Fariseos juntaron concilio, y dec\xedan: \xbfQu\xe9 hacemos? porque este hombre hace muchas se\xf1ales.",strong:[{text:"este",strong:"G3778",start:89,end:93},{text:"hombre",strong:"G444",start:94,end:100}]},{number:48,text:"Si le dejamos as\xed, todos creer\xe1n en \xe9l: y vendr\xe1n los Romanos, y quitar\xe1n nuestro lugar y nuestra naci\xf3n.",strong:[{text:"creer",strong:"G4100",start:25,end:30}]},{number:49,text:"Y Caif\xe1s, uno de ellos, sumo pont\xedfice de aquel a\xf1o, les dijo: Vosotros no sab\xe9is nada;",strong:[{text:"nada",strong:"G3762",start:82,end:86}]},{number:50,text:"Ni pens\xe1is que nos conviene que un hombre muera por el pueblo, y no que toda la naci\xf3n se pierda.",strong:[{text:"hombre",strong:"G444",start:35,end:41},{text:"pueblo",strong:"G1484",start:55,end:61}]},{number:51,text:"Mas esto no lo dijo de s\xed mismo; sino que, como era el sumo pont\xedfice de aquel a\xf1o, profetiz\xf3 que Jes\xfas hab\xeda de morir por la naci\xf3n:",strong:[{text:"esto",strong:"G3778",start:4,end:8},{text:"como",strong:"G2531",start:43,end:47}]},{number:52,text:"Y no solamente por aquella naci\xf3n, mas tambi\xe9n para que juntase en uno los hijos de Dios que estaban derramados.",strong:[{text:"Dios",strong:"G2316",start:84,end:88}]},{number:53,text:"As\xed que, desde aquel d\xeda consultaban juntos de matarle.",strong:[{text:"jour",strong:"H3117",start:7,end:11},{text:"faire",strong:"G1080",start:34,end:39}]},{number:54,text:"Por tanto, Jes\xfas ya no andaba manifiestamente entre los Jud\xedos; mas fu\xe9se de all\xed \xe1 la tierra que est\xe1 junto al desierto, \xe1 una ciudad que se llama Ephraim: y est\xe1base all\xed con sus disc\xedpulos.",strong:[{text:"tierra",strong:"H776",start:87,end:93},{text:"desierto",strong:"G2048",start:112,end:120}]},{number:55,text:"Y la Pascua de los Jud\xedos estaba cerca: y muchos subieron de aquella tierra \xe1 Jerusalem antes de la Pascua, para purificarse.",strong:[{text:"tierra",strong:"H776",start:69,end:75}]},{number:56,text:"Y buscaban \xe1 Jes\xfas, y hablaban los unos con los otros estando en el templo: \xbfQu\xe9 os parece, que no vendr\xe1 \xe1 la fiesta?",strong:[{text:"dans",strong:"H6887",start:61,end:65}]},{number:57,text:"Y los pont\xedfices y los Fariseos hab\xedan dado mandamiento, que si alguno supiese d\xf3nde estuviera, lo manifestase, para que le prendiesen.",strong:[{text:"mandamiento",strong:"G1785",start:44,end:55}]}]},a=o}}]);
